import { NavLink } from 'react-router-dom';

const Navigation = () => {

    const activeStyle = {
        fontWeight: 600
    }
      return (
        <nav>
          <ul>
            <li><NavLink to='/hello' activeStyle={activeStyle}> Start </NavLink></li>
            <li><NavLink to='/teaList' activeStyle={activeStyle}> Twój dziennik herbaciany </NavLink></li>
            <li><NavLink to='/addNewTea' activeStyle={activeStyle}> Dodaj herbatę </NavLink></li>
            <li><NavLink to='/learn' activeStyle={activeStyle}> Dowiedz się więcej </NavLink></li>
          </ul>
        </nav>
      );
}

export default Navigation;
